# fly.toml file generated for gawain on 2022-08-22T15:07:37+08:00

app = "gawain"
kill_signal = "SIGTERM"
kill_timeout = 5
processes = []

[deploy]
  release_command = "/app/bin/migrate"

[env]
  CERT_FILE_PATH = ""
  INTEGRATED_TURN_PORT_RANGE = "8000-8010"
  INTEGRATED_TURN_IP="fly-global-services"
  KEY_FILE_PATH = ""
  PHX_HOST = "gawain.fly.dev"
  PORT = "8080"
  USE_INTEGRATED_TURN = "false"
  USE_TLS = "false"

[mounts]
  source = "data"
  destination = "/app/bin/uploads"

[experimental]
  allowed_public_ports = []
  auto_rollback = true

[[services]]
  http_checks = []
  internal_port = 8080
  processes = ["app"]
  protocol = "tcp"
  script_checks = []

  [services.concurrency]
    hard_limit = 25
    soft_limit = 20
    type = "connections"

  [[services.ports]]
    force_https = true
    handlers = ["http"]
    port = 80

  [[services.ports]]
    handlers = ["tls", "http"]
    port = 443

  [[services.tcp_checks]]
    grace_period = "1s"
    interval = "15s"
    restart_limit = 0
    timeout = "2s"

